#
# Unusual observation: Python allows more than 49K recursive calls in case of test case
# no. 9. But it fails with "RecursionError: maximum recursion depth exceeded" when the
# number of recursive calls reaches 1000 for test case no. 10. Why so??
# It works for all testcases in LeetCode OJ though.
#
from typing import List
from collections import defaultdict

class Solution:
    def __init__(self):
        self.calls = 0

    def jump(self, nums: List[int]) -> int:
        '''
            F(i,j) = total number of steps to reach nums[N-1] when starting from index i
                     and making an initial jump of j steps
            Ans = min(F(0,1), F(0,2), F(0,3), ..., F(0, j)) where 0 <= j <= nums[0] and i + j < N
            F(i, j) = min(F(i+1, 1), F(i+2, 2), ... F(i+j, j))
            F(N-1, j) = 0   => terminating condition
        '''
        def solve(i):
            self.calls += 1
            #print(self.calls)
            if i == N - 1:
                return 0
            if i in memo:
                return memo[i]
            min_val = float('inf')
            for j in range(1, nums[i] + 1):
                if i + j < N:
                    tmp = solve(i + j)
                    min_val = min(min_val, tmp)
            memo[i] = 1 + min_val
            return memo[i]
        N = len(nums)
        memo = defaultdict(int)
        res = solve(0)
        return res

